import React from "react";
import { Container, Row, Col } from 'reactstrap';

class TopNews extends React.Component{
    render(){
        return (
              <div className="TopNews">
                  <div className="news container">
                        <h2>TopNews</h2>
                  </div>
              </div>
        );
    }
}
export default TopNews;
